import usuarios from '../models/usuarios';

export const updateUsuarios = async (req, res) => {
    try{
        const {id} = req.params;
        const body = req.body;
        const userUpdate = await usuarios.update({
            body
        },
        {
            where: {
                id
            }
        });
        res.json({
            message: 'Usuario actualizado correctamente',
            resultado: true,
            usuarios: userUpdate
        });
    }catch(e){
        console.log(e);
        res.json({
            message: 'Ha ocurrido un error, porfavor contactese con el administrador',
            resultado: true,
            usuarios: null
        });
    };
};

export const deleteUsuarios = async (req, res) => {
    try{
        const {id} = req.params;
        await usuarios.destroy({
            where: {
                id
            }
        });
        res.json({
            message: 'Usuario eliminado correctamente',
            resultado: true
        });
    }catch(e){
        console.log(e);
        res.json({
            message: 'Ha ocurrido un error, porfavor contactese con el administrador',
            resultado: false
        });
    };
};

export const getUsuariosId = async (req, res) => {
    try{
        const {id} = req.params;
        const user = await usuarios.findOne({
            where: {
                id
            },
            attributes: [
                'id', 
                'rut', 
                'nombre', 
                'apellido', 
                'roles_id',
                'correo',
                'verificacion',
                'contrasea'
            ]
        });
        res.json({
            resultado: true,
            message: "",
            usuario: user
        });
    }catch(e){
        console.log(e);
        res.json({
            message: 'Ha ocurrido un error, porfavor contactese con el administrador',
            resultado: false,
            usuario: null
        });
    }
};

export const getAllUsuarios = async (req, res) => {
    try{
        const allUsers = await usuarios.findAll({
            attributes: [
                'id', 
                'rut', 
                'nombre', 
                'apellido', 
                'roles_id', 
                'contrasea', 
                'correo', 
                'verificacion'
            ],
            order: [
                [
                    'id', 
                    'DESC'
                ]
            ]
        });
        res.json({
            resultado: true,
            message: "",
            usuarios: allUsers
        });
    }catch(e){
        console.log(e);
        res.json({
            message: 'Ha ocurrido un error, porfavor contactese con el administrador',
            resultado: false,
            usuarios: null
        });
    }
};

